INSERT INTO `bidders` VALUES (30,'GIZ-PREVENIR','giz-prevenir','21215209','78777489','http://www.gizprevenir.com','<p>Fortalecimiento del intercambio interinstitucional de los enfoques de prevención de violencia y anclaje de dichos enfoques en los sistemas nacionales y municipales.</p>','<p>PREVENIR tiene como objetivo fortalecer la articulación intersectorial de las organizaciones e instituciones que trabajan en la prevención de violencia en los municipios seleccionados por el Programa, potenciando las habilidades para la empleabilidad de jóvenes y contribuyendo así a la disminución de la violencia que los afecta. Desarrollado en el marco de la Estrategia de Seguridad de Centroamérica, ESCA.</p><p><br></p><p>Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH,&nbsp;Agencia GIZ San Salvador, Apdo. Postal 755 ....</p><p><br></p><p><a href=\"https://www.google.com.sv/maps/@13.6639303,-89.2620243,16z\" style=\"background-color: rgb(255, 255, 255);\" target=\"_blank\">Bulevar Orden de Malta Casa de Cooperación Alemana, Urbanización Santa Elena, Antiguo Cucatlán</a></p><p>La Libertad, El Salvador, C.A.</p><p><br></p>','PREVENIR es el Programa Regional  Prevención de la Violencia Juvenil en Centroamérica',1,1726,2,10,179,30,NULL,NULL,'2016-02-10 18:14:36','2017-10-26 21:57:37',NULL,0,0,0,0,1,NULL,0),(73,'CONAMYPE','conamype','25929000','','http://www.conamype.gob.sv','<!--StartFragment--><p>CONAMYPE brinda diferentes servicios para empresarios, empresarias y personas que desean iniciar un negocio. Estos apoyos están disponibles en las Oficinas regionales de CONAMYPE, en los CEDART (oficinas especializadas en atención al sector artesanal) y en los CDMYPE (oficinas de asesoría empresarial que operan en coordinación con universidades y organizaciones no gubernamentales). Busque la oficina más cercana y conozca los servicios que puede encontrar en ella.</p><!--EndFragment-->','<!--StartFragment--><p>Fortalecer y desarrollar a la micro y&nbsp;<a href=\"http://www.conamype.gob.sv/?glossary=pequena-empresa\" data-cmtooltip=\"Según la definición oficial, en El Salvador una Pequeña Empresa es la persona natural o jurídica que opera en el mercado produciendo y/o comercializando bienes o servicios por riesgo propio, a través de una unidad organizativa, con un nivel de ventas brutas anuales de hasta un millón de dólares y hasta 50 trabajadores remunerados.\" target=\"_blank\" rel=\"nofollow\">pequeña empresa</a>&nbsp;para lograr un desarrollo económico justo, democrático, sostenible&nbsp; y con enfoque de género a nivel territorial, con el fin de crear sinergias que potencien la&nbsp;competitividad&nbsp;y contribuir activamente al crecimiento del país a través de la generación de empleo e ingresos.</p><!--EndFragment-->','Comisión Nacional de la Micro y Pequeña Empresa',1,1726,2,NULL,179,73,NULL,NULL,'2016-05-16 19:15:02','2016-05-16 19:25:13',NULL,0,0,0,0,3,NULL,0),(88,'Oficina PREVENIR Guatemala','oficina-prevenir-guatemala','23666049','40263026','https://www.facebook.com/TuChanceGuatemala/','<p>Publicación de oportunidades\r\nVinculamos a personas interesadas con oportunidades identificadas</p>','<p>Mantenemos vigilancia sobre oportunidades diversas que surgen en el medio guatemalteco y las publicamos para que sean accesibles a la juventud.</p>','Publicamos oportunidades que identificamos en Guatemala',1,2777,3,29,356,88,NULL,NULL,'2016-06-29 15:51:00','2017-06-21 14:42:59',NULL,0,0,0,0,2,NULL,0),(91,'JA Empresarios Juveniles de Guatemala','ja-empresarios-juveniles-de-guatemala','24401539','','http://www.jaguatemala.org','<p>Programas de formación y capaciacion a niños y jóvenes en áreas de habildiades para el trabajo, espíritu emprendedor y educación financiera.</p>','<p>La fundacion realiza alianzas con empresas, voluntarios, organizacione  y centros educativos para capacitar a los alumnos.</p>','Organización sin fines de lucro, que busca motivar y formar a las nuevas generaciones para su exitosa incorporación a la economía