><u>Catedrático de  Administración</u></b></p><p> </p><p><br></p><p><b> </b></p><p><b> </b></p><p><b>Enero 2010 - Diciembre 2010&nbsp;&nbsp;&nbsp;&nbsp; </b><b>CAMPOSANTO LA  COLINA,&nbsp;</b><b><u>Asesor  Memorial</u></b></p><p> </p><p><br></p><p><b> </b></p><p><b> </b></p><p><b>Enero 2009 - Mayo 2010 </b><b>TELEFÓNICA,&nbsp;</b><b><u>Técnico  en Telecomunicaciones Clientes Pymes</u></b></p><p> </p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p><b>Junio 2007 - Enero 2009&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </b><b>NATURAL LEARNING CORPORATION NLC, </b><b><u>Supervisora  de Ventas</u></b></p><p> </p><p><br></p>','<p><b>Educación</b></p><p><b>2,013 Licenciatura en Administración de Empresas</b></p><p><b><i>Guatemala</i></b> Bircham  International University – National Business School</p><p><b> </b></p><p><b>2,001 Perito Contador</b></p><p><b><i>Guatemala</i></b> Instituto  Evangélico América Latina</p><p><b> </b></p><p> </p><p><b><i>Idiomas:  </i></b><b>español: </b>Natal</p><p><b><i>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </i></b><b>Ingles: </b>Intermedio</p><p> </p><p><b><i>Programas manejados: </i></b>Word, Excel, Power  Point, Publisher, Internet, Windows.</p>','<p>Tengo experiencia de 7 años como administradora, a cargo del área de  producción en todo lo relacionado a procesos, desempeño, capacitación y  contratación de los empleados. Entre otras funciones preparar presupuestos  de gastos o previsión de ventas, desarrollo de estrategias de ventas,&nbsp; ejecución de todo el proceso de ventas.  Construir un organigrama o flujo grama, interpretar los balances y estados  financieros.</p>','<p>Aprendizaje continuo</p><p>Conocimiento de las necesidades de otros</p><p>Creatividad</p><p>Integridad</p><p>Ciencias aplicadas y tecnología</p><p>Resolución de problemas y toma de decisiones</p><p>Tra