INSERT INTO `opportunities` VALUES (49,'Curso de Microsoft PowerPoint 2010','curso-de-microsoft-powerpoint-2010','Curso de Microsoft PowerPoint 2010, Apoyado 100% por INSAFORP. \r\n																																																								','<p>En el marco del Programa Hábil Técnico Permanente de Formación Inicial del Instituto Salvadoreño de Formación Profesional INSAFORP, El Centro de Formación CAPUCOM S.A. DE C.V. ofrecen: </p>','<ul><li>Presentar fotocopia de DUI/NIT,</li><li>Ser mayor de 16 años (NIT)</li></ul><p><br></p>','<p>Curso de Microsoft PowerPoint 2010, 100% Apoyado por INSAFORP.</p><p>Fecha de Inicio: 16 de marzo 2016, </p><p>Horarios: Lunes a Viernes de 8:00 AM – 12 MD y de 1.00 PM – 5.00 PM </p><p>Lugar: LA PAZ, Col. José Simeón Cañas #1 una cuadra al sur de la CURACAO, Zacatecoluca, La PAZ (En el local de la Iglesia Dios de Israel)</p><p>Contactos:  7840-4832, 7853-5285</p><p>Email: herryflores@capucom.net</p>',NULL,NULL,2,NULL,93,30,1,'2016-02-28 01:00:00','2016-03-12 01:00:00',1,1,NULL,49,'2016-02-29 16:54:57','2016-03-11 16:34:42',NULL,0,0,0,NULL,NULL,0),(63,'Cursos Onlines Masivo Abiertos - MOOC - COMA','cursos-onlines-masivo-abiertos-mooc-coma','Cursos Onlines Masivo Abiertos ','<p>Hemos facilitado el agrupamiento de los mejores Cursos Online para facilitar su acceso y registro, así no tienes que estar buscando en la nube.</p>','<p>Cada oferente establece sus requisitos: <a href=\"http://wwwtuchanceorg.wix.com/cursos\" rel=\"nofollow\" target=\"_blank\" title=\"En línea\">Presiona Aquí para ver los cursos</a>&nbsp;</p>','<p>La mayoría de los cursos son gratis pero hay otros que tiene que pagarse según lo establezca el oferente.</p><p><br></p><p>Los <a href=\"https://es.wikipedia.org/wiki/Mooc\" rel=\"nofollow\" target=\"_blank\" title=\"En línea\">MOOC</a> (acrónimo en inglés de <em>Massive Open Online Course)</em> o COMA &nbsp;en español (Curso Online Masivo Abierto) son cursos <a href=\"https://es.wikipedia.org/wiki/En_l%C3%ADnea\" rel=\"nofollow\" target=\"_blank\" title=\"En línea\">en línea</a> dirigidos a un amplio número de participantes a través de Internet según el principio de <a href=\"https://es.wikipedia.org/wiki/Educaci%C3%B3n_abierta\" rel=\"nofollow\" target=\"_blank\" title=\"Educación abierta\">educación abierta</a> y masiva.</p>',NULL,NULL,2,NULL,179,30,1,'2018-03-31 23:00:00','2019-12-31 00:00:00',1,0,NULL,63,'2016-03-18 22:22:12','2018-05-03 16:43:49',NULL,0,0,0,NULL,NULL,0),(171,'Formación Emprendedora - San Salvador','formacion-emprendedora-san-salvador','Formación en Emprendedurismo - San Salvador.','<p>Iniciativa formación emprendedora <strong>JUVENTUD EMPRENDE 2016 en San Salvador</strong></p><p><br></p>','<p>Llena el siguiente formulario si vives en el Departamento de San Salvador:&nbsp;</p><p><br></p><p><br></p><p>Formulario de Inscripción: <a href=\"http://goo.gl/forms/Y1MXFDrcOR\" rel=\"nofollow\" style=\"background-color: rgb(255, 255, 255);\" target=\"_blank\">http://goo.gl/forms/Y1MXFDrcOR</a></p><p><br></p><table align=\"center\" width=\"792\"><tbody><tr><td width=\"111\">Tel: <br>2592 9061</td><td width=\"309\"><u>email: <a href=\"mailto:eguevara@conamype.gob.sv\" target=\"_blank\">eguevara@conamype.gob.sv</a></u></td><td width=\"316\"><br><br></td></tr></tbody></table><p><br></p><p><br></p><!--EndFragment-->','<!--StartFragment--><div>Hay que llenar el formulario de inscripción para poder participar.</div><!--EndFragment-->',NULL,NULL,2,NULL,179,73,3,'2016-05-16 02:00:00','2016-12-31 01:00:00',1,0,NULL,171,'2016-05-16 19:32:17','2016-11-01 15:14:40',NULL,0,0,0,NULL,NULL,0),(172,'Formación Emprendedora - Santa Ana','formacion-emprendedora-santa-ana','Formación en Emprededurismo - Santa Ana','<p>Iniciativa formación emprendedora <strong>JUVENTUD EMPRENDE 2016 en Santa Ana</strong></p>','<p>Llenar el siguiente formulario:</p><p><br></p><!--StartFragment--><table align=\"center\" width=\"792\"><tbody><tr><td width=\"316\"><u>Formulario de Inscripción: <a href=\"http://goo.gl