    </p><p><br><!--EndFragment--></p><p>            </p><p>          </p><p>        </p><p>      </p><p>    </p><p>  </p>',NULL,NULL,3,NULL,301,88,1,'2016-06-30 00:00:00','2016-12-22 00:01:00',1,1,NULL,208,'2016-06-29 17:15:30','2016-06-29 17:15:42',NULL,0,0,0,NULL,NULL,0),(209,'FINLANDIA - CONCURSO LITERARIO INTERNACIONAL EN IDIOMA ESPAÑOL','finlandia-concurso-literario-internacional-en-idioma-espanol','Convoca su décima edición, correspondiente a la modalidad de 												cuento. El tema será libre.','<p>Encuentra información en el siguiente vínculo </p><p>https://sites.google.com/site/concursoliterariointernacional/</p>','<p>Personas mayores de edad de cualquier nacionalidad, que presenten cuentos (una obra por cada concursante) en lengua española, originales e inéditos, no publicados en ningún tipo de formato ni total ni parcialmente (incluido Internet), no premiados o pendientes de fallo en otros concursos, o a la espera de respuesta en un proceso editorial.</p>','<p align=\"LEFT\">El premio consistirá en una dotación de 500 euros y diploma. Así mismo, el ganador tendrá el honor de ser</p><p>retratado por el pintor valenciano Alejandro Cabeza, dicho retrato está valorado en 6.000€. </p><p align=\"LEFT\">El fallo será inapelable y se hará público durante la entrega de premios que tendrá lugar en el Salón de Actos</p><p>de la Delegación de la Unión Europea en Helsinki.</p>',NULL,NULL,3,NULL,356,88,2,'2016-06-30 00:00:00','2016-08-01 00:00:00',1,1,NULL,209,'2016-06-30 16:11:43','2016-07-05 18:54:45',NULL,0,0,0,NULL,NULL,0),(210,'FINLANDIA. Concurso literario internacional en español','finlandia-concurso-literario-internacional-en-espanol','Concurso Literario Internacional Ángel Ganivet convoca a su décima edición, correspondiente a la modalidad de cuento. El tema será libre.','<p>Si escribes cuentos y no los has publicado tienes la oportunidad de participar en este concurso internacional y ganar un premio.  Para mayor informacion visita este vínculo </p><p>https://sites.google.com/site/concursoliterariointernacional/</p>','<p>Personas mayores de edad de cualquier nacionalidad, que presenten cuentos (una obra por cada concursante) en lengua española, originales e inéditos, no publicados en ningún tipo de formato ni total ni parcialmente (incluido Internet), no premiados o pendientes de fallo en otros concursos, o a la espera de respuesta en un proceso editorial.</p>','<p align=\"LEFT\">El premio consistirá en una dotación de 500 euros y diploma. Así mismo, el ganador tendrá el honor de ser</p><p>retratado por el pintor valenciano Alejandro Cabeza, dicho retrato está valorado en 6.000€.</p>',NULL,NULL,3,NULL,356,88,4,'2016-06-30 00:00:00','2016-08-01 00:00:00',1,1,NULL,210,'2016-06-30 16:17:44','2016-07-05 18:59:27',NULL,0,0,0,NULL,NULL,0),(214,'2o. Taller INDESGUA 2016 Quetzaltenango','2o-taller-indesgua-2016-quetzaltenango','El 7 de julio por la mañana Taller para orientar a jóvenes para obtener becas en el extranjero.','<p>El taller consiste en proveer orientación, requisitos, procedimientos para asegurar que una solicitud de beca puede tener oportunidad de ser aprobada.  Conoceras diferentes opciones de becas</p>','<p>Escribir a Luis Arenas <a href=\"mailto:indesgua.lea@gmail.com\">indesgua.lea@gmail.com</a>  para inscribirse en el taller y recibir información de la ubicación del taller. </p>','<p>El taller se realizará de 8:00 a 12:00 el día 7 de julio en la ciudad de Quetzaltenango</p>',NULL,NULL,3,NULL,459,88,2,'2016-07-04 00:00:00','2016-07-07 00:01:00',1,1,NULL,214,'2016-07-04 14:04:16','2016-07-04 19:54:15',NULL,0,0,0,NULL,NULL,0),(215,'Festival del EMPLEO 2016','festival-del-empleo-2016','25 y 26 de julio Festival de empleo en el centro de convenciones Gran Tikal Futura Hotel, participan  empresas que buscan talento humano.','<p>Los días lunes 25 y martes 26 de julio se realizará el festival del empleo donde participan muchas empresas como: CEMACO, Banco Industrial, Cervecería Centroamericana, TELUS, SIMAN, GENPACT, TecniScan, Señoriales, COLGATE, 24/7 y muchas más.</p>','<p>Solo tienes que traer tu curriculum, la entrada es gratuita.</p>','<p>Presentate con tu CV el lunes 25 o el martes 26 de julio en el centro de Convenciones del Gran Tikal Futura Hotel.</p>',NULL,NULL,3,NULL,356,88,5,'2016-07-04 00:00:00','2016-07-26 00:00:00',1,1,NULL,215,'2016-07-04 18:31:49','2016-07-04 19:44:36',NULL,0,0,0,NULL,NULL,0),(216,'TALLER  BECAS DE CHILE  2017','taller-becas-de-chile-2017','El 9 de julio, Taller para conocer herramientas y consejos realistas para irte a estudiar al extranjero?  \r\n¡Participa en el taller!  \r\n','<p>El Taller  te ayudará a identificar lo mejor  en tu persona para que te distingas entre los cientos de solicitudes que reciben los comités de evaluación, y puedas convertirte en merecedor de una beca para realizar estudios universitarios en Chile. </p>','<p>Escribir a Luis Arenas (<a href=\"mailto:indesgua.lea@gmail.com\" target=\"_blank\">indesgua.lea@gmail.com</a>)  solicitando participar.</p>','<p>Aunque a veces conocemos sobre becas para realizar estudios universitarios no sabemos como presentar nuestra aplicación y que pasos hay que seguir para asegurar que nuestra solicitud es considerada.<br></p>',NULL,NULL,3,NULL,356,88,2,'2016-07-04 00:00:00','2016-07-09 00:00:00',1,1,NULL,216,'2016-07-04 21:13:36','2016-07-04 21:13:36',NULL,0,0,0,NULL,NULL,0),(217,'Programa Mujeres Emprendedoras','programa-mujeres-emprendedoras','Programa para mujeres mayores de edad, que forma para iniciar una empresa o fortalecer una negocio en etapa de inicio.','<p>El programa se impartirá del 18 de Julio al 20 de Septiembre en horario de 9.00 a 12.00 hrs. a.m los días, lunes, miércoles o jueves.</p>','<p>Completar ficha de inscripción en el Kiosco de información, 1er. nivel del Centro Comericial Portales.</p><p>Mujeres mayores de edad</p><p>Nivel escolar por lo menos 3er. Básico</p><p>Presentar DPI al momento de incripción</p><p>Firmar convenio de cumplimiento de asistencia y aprovechamiento del programa.</p>','<p>Curso de Emprendimiento sin costo para mujeres.</p>',NULL,NULL,3,NULL,356,91,3,'2016-07-04 10:00:00','2016-07-10 17:00:00',1,1,NULL,217,'2016-07-04 21:57:32','2016-07-04 21:57:32',NULL,0,0,0,NULL,NULL,0),(220,' LA ONU CONVOCA LOS PREMIOS RANAN LUIRÉ 2016 A LA MEJOR CARICATURA POLÍTICA ','la-onu-convoca-los-premios-ranan-luire-2016-a-la-mejor-caricatura-politica','Concurso de La Organización de las Naciones Unidas (ONU) para recibir caricaturas humorísticas que opten a los Premios Ranan Lurie 2016','<p>Los premios Ranan Lurie, nombrados así en homenaje al  dibujante especializado en sátira y crítica política, vuelven a ser convocados  por la Organización de Naciones Unidas.</p><p>El comité de expertos elegirá trece obras que sobresalgan en  arte, análisis político y humor, y que a la vez reflejen correctamente los  valores y principios de la institución en materia de derechos humanos y  relación cordial entre países.</p><p> </p>','<p>Pueden participar todos aquellos dibujantes profesionales  que hayan publicado una caricatura política en cualquier medio, de cualquier  lugar y en cualquier idioma.  Sólo se  aceptarán publicaciones que incluyan el nombre del medio, el idioma y la fecha,  y deberán acompañarse de una reimpresión de la publicación traducida al  inglés. DEBES CONSULTAR ESTA PÁGINA PARA MAS INFORMACIÓN http://lurieunaward.com/ </p><p><br></p><p> </p>','<p>Todos los materiales recibidos, incluidos los ganadores, pasarán a ser propiedad del comité de los Ranan Lurie Political Cartoons Awards. La inscripción es gratuita y deberá realizarse antes del 15 de noviembre de 2016, presentando copias de trabajos (no los originales) que deben haber sido publicados entre principios de septiembre de 2015 y el 15 de octubre de 2016. &nbsp;Premios:  a) Primer premio: 10.000$ + placa (8.968€) b) Segundo premio: 5.000$ + placa  (4.484€) c) Tercer premio: 3.000$ + placa (2.690€) d) 10 menciones de honor que  recibirán una placa otorgada por las Naciones Unidas&nbsp;</p>',NULL,NULL,3,NULL,356,88,4,'2016-07-06 00:00:00','2016-11-14 00:00:00',1,1,NULL,220,'2016-07-06 20:04:43','2016-07-06 20:10:45',NULL,0,0,0,NULL,NULL,0),(221,' V CONCURSO Y EXHIBICIÓN DE FOTOGRAFÍA “POR SER NIÑA”  ','v-concurso-y-exhibicion-de-fotografia-por-ser-nina','Concurso y exhibición de fotografía “Por ser niña” dirigido a fotóografos, aficionados, niños, niñas y adolescentes a participar.','<p>Aficionados a la fotografía, niños, niñas y adolescentes comparten su visión sobre la vida de las niñas de América Latina yrespetando sus derechos y su dignidad. El tema es empoderamiento de las niñas y adolescentes de América Latina, con fotografías que representen y transmitan sus derechos, de una forma respetuosa, digna y alegre. Las fotografías deben reflejar a niños y niñas en su realidad diaria, sus valores y principios relacionados con sus libertades fundamentales</p>','<p>Las obras deben ser entregadas en alguno de estos lugares: oficinas de Plan International de los países participantes, o enviadas vía correo electrónico a porsernina2016@gmail.com.&nbsp;&nbsp;&nbsp;&nbsp; Deben estar acompañadas de sus respectivos sobres y el formulario (uno por persona participante), pegados en la parte posterior de la fotografía, si se entregan físicamente.&nbsp;&nbsp; </p><p>La fecha de cierre de entrega de los trabajos es viernes 26 de agosto de 2016 a las 5:00 p.m. hora de Panamá (GMT-5). No se aceptarán trabajos luego de la hora de cierre.&nbsp; </p><p>POR FAVOR CONSULTAR:&nbsp; http://porsernina2016.org/index.html&nbsp;&nbsp; </p>','<p>Categorías: Profesional; Abierta; y Niñez, o “Pequeños Grandes Fotógrafos”. En la categoría Abierta, pueden participar todas las personas no profesionales y aficionadas a la fotografía, y que tengan 18 años cumplidos al 26 de agosto de 2016.&nbsp; En la categoría Pequeños Grandes Fotógrafos, pueden participar todos los niños y niñas menores de 18 años hasta el 26 de agosto de 2016.&nbsp; Se seleccionarán las fotos ganadoras en las tres categorías, que pasarán a competir a nivel regional. Los participantes de las tres categorías también participan en la elección de “La Favorita” en Redes Sociales, vía Facebook, donde se presentarán las fotografías de las tres categorías juntas y el público vota a través de “Likes” por su fotografía favorita.&nbsp;&nbsp;&nbsp; En este concurso no podrá participar personal de Plan International. No se cobra derecho de inscripción.</p>',NULL,NULL,3,NULL,301,88,4,'2016-07-06 00:00:00','2016-08-26 00:00:00',1,1,NULL,221,'2016-07-06 22:26:17','2016-07-06 22:26:17',NULL,0,0,0,NULL,NULL,0),(223,'PREMIO IBEROAMERICANO JÓVENES TALENTOS BRAGA ´16','premio-iberoamericano-jovenes-talentos-braga-16','Concurso para fomentar el surgimiento de talentos en la danza, música, canto, artes del espectáculo, magia, teatro y otras artes escenicas ','<p>Dentro de la celebración de Braga 2016 Capital Iberoamericana de la Juventud, el municipio portugués</p><p>pone en marcha esta convocatoria dirigida a jóvenes de los 21 países que integran la Organización</p><p>Iberoamericana de Juventud (OIJ) con edades comprendidas entre los 10 y los 18 años</p>','<p>Los concursantes deberán inscribirse, individualmente o en grupo, a través del correo<br>electrónico ciaj2016@cm-braga.pt,   enviando una maqueta de su presentación en formato de vídeo, con un máximo de 5 minutos, hasta el día 15 de julio de 2016.Jóvenes naturales de los 21 países que integran la OIJ (Organización Iberoamericana de la Juventud) con edades comprendidas entre los 10 y los 18 años, con talento para la danza, música, canto, artes del espectáculo, magia, teatro u otras actividades que pueden ser presentados en escenario individualmente o en dueto</p>','<p>Los premios son de 2.500€, 1.500€ y 1.000€.</p>',NULL,NULL,3,NULL,356,88,4,'2016-07-07 00:00:00','2016-07-15 00:00:00',1,1,NULL,223,'2016-07-07 21:04:15','2016-07-07 21:05:15',NULL,0,0,0,NULL,NULL,0),(252,'Becas Respostería Basica','becas-resposteria-basica','25 Becas para el curso de Repostería Básica, dirigido a jóvenes de 17 a 29 años de Rabinal, B.V.','<p>La Municipalidad de Rabinal, Baja Verapaz juntamente con Intecap y MINTRAB dan la oportunidad a jóvenes de 17 años a 29 inscribirse al curso  de Repostería Básica. Mayor información en la oficina de la Niñez y adolecencia (Rosario Alvarado 42909259) o Centro de Desarrollo Tecnológico (Paul Ventura 42141699)</p>','<p>de 17 a 29 años</p><p>Fotocopia de DPI o </p><p>Certificado de Nacimiento</p>','<p>Creación de platillos.</p>',NULL,NULL,3,NULL,300,101,2,'2016-08-04 00:00:00','2016-08-28 12:00:00',1,1,NULL,252,'2016-08-04 14:38:12','2016-08-24 16:37:05',NULL,0,0,0,NULL,NULL,0),(253,'Becas Elaboración de velas simples y aromáticas','becas-elaboracion-de-velas-simples-y-aromaticas','25 Becas para el curso de Elaboración de velas simples y aromáticas, dirigido a jóvenes de 17 a 29 años de Rabinal, B.V.','<!--StartFragment--><p>La Municipalidad de Rabinal, Baja Verapaz juntamente con Intecap y MINTRAB dan la oportunidad a jóvenes de 17 años a 29 inscribirse al curso de Repostería Básica. Mayor información en la oficina de la Niñez y adolecencia (Rosario Alvarado 42909259) o Centro de Desarrollo Tecnológico (Paul Ventura 42141699)</p><!--EndFragment-->','<!--StartFragment--><p>de 17 a 29 años</p><p>Fotocopia de DPI o </p><p>Certificado de Nacimiento</p><!--EndFragment-->','<p>Becas destinadas para toda la población de Rabinal, B.V. que tengan el deseo de capacitarse en el curso de elaboración de velas simples y aromáticas </p>',NULL,NULL,3,NULL,300,101,2,'2016-08-04 00:00:00','2016-08-28 12:00:00',1,1,NULL,253,'2016-08-04 15:01:51','2016-08-24 16:36:42',NULL,0,0,0,NULL,NULL,0),(256,'Curso Basico de Computacion','curso-basico-de-computacion','Curso básico de computacion','<p>Curso basico de computacion, con una duracion de 40 horas.</p>','<p>Saber leer y escribir</p><p><br></p><p>Llenar ficha de inscripcion </p><p><br></p><p>Mayores de 12 años</p><p><br></p><p>Fotocopia de fe de edad o DPI</p><p><br></p><p>Hombres y mujeres</p>','<p>Se estáran realizando cursos de computación a adolescentes, jóvenes y adultos hombres y mujeres de los diferentes barrios y aldeas del municipio, del cual se están realizando en un periodo de dos horas dos veces por semana y cuatro horas los fines de semana con una duración de tres meses.</p>',NULL,NULL,3,NULL,301,102,1,'2016-08-10 00:00:00','2016-08-19 00:00:00',1,1,NULL,256,'2016-08-10 16:40:57','2016-08-10 16:40:57',NULL,0,0,0,NULL,NULL,0),(259,'Becas para estudiar en el extranjero','becas-para-estudiar-en-el-extranjero','SEGEPLAN te invita a la XIV Feria Nacional de Becas. Se brindará información para estudiar en otros países','<p>En la feria recibiras información para obtener una beca para licenciatura, maestría o doctorado en países como Brasil, Taiwan, Japón, Corea, Israel, Rusia, India, Egipto, México y Chile.</p>','<p>Si estás en el último año de diversificado o ya te graduaste de educación media, puede intersarte las oportunidades que se te ofrecen.  Así mismo si eres graduado de una licenciatura puedes optar a una maestría en el extranjero.  También hay oportunidades para doctorados.  Registrate en el código que aparece arriba.</p>','<p>Asiste a la Feria Nacional de Becas en el Lobby del Instituto Guatemalteco de Turismo INGUAT 7a. Avenida 1-17 zona 4 Guatemala, Ciudad; los días 19 y 20 de agosto de 2016. </p>',NULL,NULL,3,NULL,356,88,2,'2016-08-11 00:00:00','2016-08-20 00:00:00',1,1,NULL,259,'2016-08-11 13:37:14','2016-08-11 13:37:46',NULL,0,0,0,NULL,NULL,0),(268,'TALLER DE BECAS INDESGUA 2016  (VESPERTINO)','taller-de-becas-indesgua-2016-vespertino','El taller te ayudará a identificar lo mejor  en tu persona para presentar tu solicitud de una beca para estudiar en el extranjero','<p><strong>¿Quieres conocer todas las herramientas útiles y consejos  realistas para irte a estudiar al extranjero?  </strong></p><p>Además, queremos motivarte  a tomar una decisión lo antes posible y que pongas en marcha un plan para ganar  una beca,  cumplir tus metas,  alcanzar tus sueños y tener una  experiencia extraordinaria en tu vida  </p>','<p>Para participar en el taller, debes escribir a Luis Arenas (<a href=\"mailto:indesgua.lea@gmail.com\" target=\"_blank\">indesgua.lea@gmail.com</a>)  solicitando  participar, solo a través del correo puedes inscribirte.  El cupo es limitado.  Puedes participar si eres graduado de educación media (bachilleres, peritos, maestros, secretarias, contadores, etc.) o estás por graduarte.</p>','<p><strong>El taller va dirigido a</strong> estudiantes y profesionales  interesados en continuar estudios de <b>pregrado (licenciatura) y  postgrado (maestría y doctorado)  en el extranjero</b> beneficiado por una beca. Para estudiar en  cualquier parte del mundo.  INDESGUA ha apoyado exitosamente a<b> 632  procesos becarios, de  ellos obtuvieron beca 424  para estudiar en 49  países de los 5 continentes. </b>Un alto porcentaje de los que  participan en los talleres de INDESGUA  y que se comprometen con sus cumplir  los requisitos ganan una beca.</p>',NULL,NULL,3,NULL,356,88,2,'2016-08-22 00:00:00','2016-08-26 00:00:00',1,1,NULL,268,'2016-08-22 14:37:24','2016-08-22 14:38:02',NULL,0,0,0,NULL,NULL,0),(269,'Becas para estudiar Perito Agrónomo y Perito Forestal en la ENCA ','becas-para-estudiar-perito-agronomo-y-perito-forestal-en-la-enca','Abierto el proceso de admisión para estudiar Perito Agrónomo y Perito Forestal en la Escuela Nacional Central de Agricultura ENCA ','<p>La Admisión consta de dos fases : 1) Examen de Preselección,  deben sustentar los aspirantes en un único día, en diferentes sedes en todo el  país. Se realiza al final de octubre.  2)  Curso Propedéutico, lo reciben quienes han aprobado el examen de preselección;  induce al aspirante al sistema educativo de la ENCA y ayuda a la selección  final de los estudiantes de nuevo ingreso.</p>','<p><b>Los requisitos de  inscripción para el Examen de Preselección son: </b>1.  Formulario de  Solicitud  2. Realizar el pago de derecho  a examen (Q. 25.00). 3. Certificación General de  Estudios del Ciclo Básico con todas las asignaturas aprobadas. 4. Original o copia legalizada  de Certificación de partida de nacimiento reciente (no más de 6 meses) emitida  por el RENAP. 5.  Ser menor de 18 años de  edad al 29 de octubre de 2016  </p><p>Más información en: <a href=\"http://www.enca.edu.gt/enca2/index.php/estudian-en-enca/admision/\" target=\"_blank\">http://www.enca.edu.gt/enca2/index.php/estudian-en-enca/admision/</a>    </p>','<p> </p><p>La ENCA ofrece las carreras  de Perito Forestal y Perito Agrónomo. La carrera de <a href=\"http://www.enca.edu.gt/enca2/archivos/pensumPF.png\" target=\"_blank\"><b>Perito Forestal</b></a><b><u> </u></b>se especializa  en recursos naturales renovables, bosque, flora, fauna, agua y suelo.</p><p>La carrera de <a href=\"http://www.enca.edu.gt/enca2/archivos/pensumPA.png\" target=\"_blank\"><b>Perito Agrónomo</b></a> dirige su formación a la  especialización en procesos de producción, transformación y comercialización de  productos agrícolas</p>',NULL,NULL,3,NULL,300,88,2,'2016-08-22 00:00:00','2016-10-30 00:00:00',1,1,NULL,269,'2016-08-22 15:39:59','2016-08-22 15:40:18',NULL,0,0,0,NULL,NULL,0),(327,'Becas para la lectura e interpretación de planos','becas-para-la-lectura-e-interpretacion-de-planos','La municipalidad de Rabinal por medio del Ministerio de Trabajo y el INTECAP te invita a que formes parte de las becas.','<p>La municipalidad de Rabinal por medio del Ministerio de Trabajo y el INTECAP te invita a que formes parte de las becas y puedas aprender a leer e interpretar un planos, utilizados en el área de ingeniería civil y arquitectura.  También lo puedes usar como base si deseas estudiar dibujo técnico.</p>','<p>- Tener disponibilidad de tiempo ya que son 200 horas, las cuales se impartiran entre semana, </p><p>- poseer más de 16  a 29 años</p><p>- fotocopia de partida de nacimiento o copia de DPI.</p>','<!--StartFragment--><p>Becas destinadas para toda la población de Rabinal, B.V. que tengan el deseo de capacitarse en el curso de lectura e interpretación de Planos.&nbsp; Para mayor información de los horarios y día de inicio del curso abocarse al centro comercial Qa\'nil en Rabinal, Baja Verapaz en las oficinas de la niñez y juventud (Rosario Alvarado) o al Centro Tecnológico de desarrollo (Paul Ventura)</p><!--EndFragment-->',NULL,NULL,3,NULL,300,101,2,'2016-10-05 00:00:00','2016-10-14 00:00:00',1,1,NULL,327,'2016-10-05 20:23:49','2016-10-05 23:11:05',NULL,0,0,0,NULL,NULL,0),(331,'PILOTO DE CABEZAL / TRAILER (zona 18)','piloto-de-cabezal-trailer-zona-18','Persona encargada y responsable de transportar producto garantizando su seguridad.','<p>Piloto de Transporte Pesado. (rastras, jaulas, palanganas, plataformas, pipas)</p>','<!--StartFragment--><p>* 6to. Primaria mínimo</p><p>* Experiencia indispensable de 2 años como piloto repartidor de transporte pesado (trailes y/o contenedores).</p><p>* Con licencia vigente de vehículo tipo A.</p><p>* Disponibilidad de horario y actitud de servicio.</p><p>* Disponibilidad para viajar al interior.</p><!--EndFragment-->','<!--StartFragment--><p>* Prestaciones de Ley.</p><p>* Estabilidad Laboral.</p><p>* Rango de salario&nbsp;Q2,747 - 5,000<br>* Rango de edad&nbsp;25 - 45<br><br><!--EndFragment--></p><!--EndFragment-->',NULL,NULL,3,NULL,356,138,5,'2016-10-06 00:00:00','2017-01-06 00:00:00',1,1,NULL,331,'2016-10-06 15:48:11','2016-10-06 15:51:57',NULL,0,0,0,NULL,NULL,0),(332,'PILOTO REPARTIDOR (zona 1)','piloto-repartidor-zona-1','Persona encargada y responsable de transportar producto garantizando las condiciones óptimas.','<p>Manejo de transporte pesado (camiones de doble eje o furgon)</p>','<!--StartFragment--><p>* 3ro. básico mínimo.</p><p>* Experiencia indispensable de 1 año como piloto repartidor de transporte (camion de doble eje).</p><p>* Experiencia en control de pedidos y repartición de producto con solicitud de documentos