rán numeradas y con el título en el reverso.</p>','<p>Para participar visita la siguiente página: http://casaculturasd.org/index.php?option=com_content&amp;view=category&amp;id=8&amp;Itemid=102</p><p>El jurado, compuesto autores de cómic profesionales y artistas locales, decidirá los premios antes del 10 de</p><p>junio de 2017.</p>',NULL,NULL,3,NULL,356,88,4,'2017-04-19 00:00:00','2017-05-12 00:01:00',1,1,NULL,465,'2017-04-19 18:34:02','2017-04-19 18:58:21',NULL,0,0,0,NULL,NULL,0),(466,'PREMIO TENERIFE AL FOMENTO Y LA INVESTIGACIÓN DE LA ARTESANÍA DE ESPAÑA Y AMÉRICA 2017','premio-tenerife-al-fomento-y-la-investigacion-de-la-artesania-de-espana-y-america-2017','El Premio Tenerife al Fomento y la Investigación de la Artesanía para investigaciones sobre las artesanías y las artes populares ','<p>El premio está destinado a reconocer los méritos de un trabajo de investigación que trate las artesanías y las artes populares de España, Portugal y todos los países de habla española y portuguesa, contemplando cualquiera de sus múltiples vertientes: investigación, recuperación de artesanías desaparecidas o en vías de extinción, promoción, comercialización u otros aspectos que incidan en el sector.</p>','<p>Las obras habrán de ser originales, no editadas ni premiadas en otros concursos. Por lo tanto, habrá de ser resultado de estudios o investigaciones propias de la persona o personas que se declaren “autor/a” o “autores” de la obra presentada a la convocatoria y no ser resultado de una actualización o adaptación de un trabajo anterior de los mismos u otras personas&nbsp;</p>','<p>El premio está dotado con 6.578,95 euros, impuestos incluidos. El plazo de presentación de trabajos terminará el 30 de julio de 2017.</p><p>PARA PARTICIPAR consultar las bases en:</p><p>http://www.oficioyarte.info/revista/files/noticia/2241/bases_17.pdf</p>',NULL,NULL,3,NULL,356,88,4,'2017-04-19 00:00:00','2017-07-30 00:00:00',1,0,NULL,466,'2017-04-19 18:53:40','2017-04-19 18:55:51',NULL,0,0,0,NULL,NULL,0),(467,'La Fundación Shuttleworth permite poner en práctica su idea innovadora para el cambio social.','la-fundacion-shuttleworth-permite-poner-en-practica-su-idea-innovadora-para-el-cambio-social','La Fundación Shuttleworth ofrece becas a las personas para poner en práctica su idea innovadora para el cambio social. ','<p>No es una beca académica destinada a la investigación o el estudio académico. Los solicitantes deben ser agentes de cambio social que empujan los límites y desafiar las normas aceptadas. Ellos no necesitan tener todas las respuestas, pero deben hacer las preguntas correctas en un contexto práctico. Estamos muy interesados en las ideas excepcionales en la intersección entre la apertura, la tecnología, el conocimiento y el aprendizaje. Ideas que realmente mover el dial en el acceso al conocimiento global, el<br>desarrollo social y económico.</p>','<p>Puede participar cualquier persona que:</p><p>Tenga una idea innovadora para el cambio social a través de nuevas ideas que aporta un valor añadido en las áreas de conocimiento, el aprendizaje y la tecnología; tenga una visión clara de cómo el mundo puede ser un lugar mejor y la contribución que pueden hacer a lograr el cambio.</p><p>Los solicitantes deben tener fluidez en inglés. &nbsp;Los postulantes deben haber alcanzado la mayoría de edad en la fecha de la solicitud.</p><p>ESCRIBA AL SIGUIENTE CORREO PARA PRESENTAR SU IDEA: fellowships@shuttleworthfoundation.org</p>','<p>Esta beca le ofrece proporcionar apoyo tecnológico, financiero y jurídico que permita a todos los procesos administrativos. &nbsp;L<strong><em>a subvención es e</em></strong><em>l equivalente del sueldo de un año, una contribución a gastos, además de acceso a una asignación de viaje.&nbsp;</em></p>',NULL,NULL,3,NULL,356,88,4,'2017-04-19 00:00:00','2017-11-01 00:00:00',1,0,NULL,467,'2017-04-19 20:21:31','2017-04-19 20:21:31',NULL,0,0,0,NULL,NULL,0),(480,'USAC 1a. Prueba de Conocimientos Básicos','usac-1a-prueba-de-conocimientos-ba