o de idioma Inglés</p><p>* Graduado o último año de alguna carrera técnica o ingeniería.</p><p>* Carta de solicitud explicando el porque quiere tomar parte en el curso y de compromisos de que asistirá a los días del curso firmada y dirigida al Dr. Oscar Cobar, Secretario Nacional de ciencia y tecnología.</p>','<p>Dirigido a profesionales de carreras técnicas e ingenierías que sean preferentemente investigadores en universidades, centros de investigación o responsables de investigación y desarrollo de empresas en Guatemala Cupo limitado, mayor información evelasquez@concyt.gob.gt</p>',NULL,NULL,3,29,356,30,1,'2017-11-08 00:00:00','2017-11-17 00:00:00',1,1,NULL,630,'2017-11-08 18:55:24','2017-11-08 18:55:25',NULL,0,0,0,NULL,NULL,0),(632,'Ilustración Digital Avanzada en Adobe Illustrator','ilustracion-digital-avanzada-en-adobe-illustrator','¿QUÉ VAS A LOGRAR CON ESTE CURSO?\r\nUn curso de ilustración avanzado es necesario para perfeccionar tu técnica y volverte el mejor ilustrador. Completando tu proyecto te darás cuenta de que eres capaz de realizar grandes cosas y que el talento no es más que la dedicación que cada uno le pone a lo que le apasiona.','<p><strong>¿QUÉ INCLUYE ESTE CURSO?</strong></p><p>En este <strong>curso de ilustración</strong>, aprenderás:</p><p>- Concepto y técnicas de composición<br>- Bocetaje<br>- Bases del diseño de personajes<br>- Anatomía y movimiento<br>- Iluminación y sombras<br>- Vectorización<br>- Colorización<br>- Composición de elementos<br>- Jerarquía visual<br>- Efectos de capas</p><p><strong>¿QUÉ PROYECTO VAS A REALIZAR?</strong></p><p>Realizarás una ilustración de un personaje ficticio usando todas las técnicas aprendidas en este <strong>curso de ilustración</strong>. La idea es componer una gráfica alucinante que refleje el carácter del personaje mediante el dibujo como el texto.</p><p><br></p><p>Accede con el siguiente <a href=\"https://goo.gl/ArvSnw\" rel=\"noopener noreferrer\" target=\"_blank\">Link</a></p>','<h2 data-reactid=\"362\"><span data-reactid=\"363\">Información</span></h2><p><span data-reactid=\"372\">Curso de nivel Avanzado</span></p><p><span data-reactid=\"379\">59 minutos de videoclases online</span></p><p><span data-reactid=\"389\">10 clases mas archivos adjuntos</span></p><p><span data-reactid=\"402\">Desarrolla un proyecto práctico</span></p><p><span data-reactid=\"410\">Accede ilimitadamente al contenido</span></p><p>Accede con el siguiente <a href=\"https://goo.gl/ArvSnw\" rel=\"noopener noreferrer\" target=\"_blank\">Link</a></p>','<h2 data-reactid=\"49\"><span data-reactid=\"50\">Sobre el Curso</span></h2><p>Ilustrar significa darle vida a nuestros sueños. Y una composición correcta sitúa nuestros personajes en el escenario adecuado y en la situación perfecta. Dominar la técnica de dibujo no es sencillo, sin embargo, yo te apoyaré para hacer todo más fácil en este <strong>curso de ilustración</strong>.</p><p>Adaptar un personaje ficticio exigirá tu imaginación y creatividad en un sentido totalmente nuevo. La idea es perfeccionar la técnica de ilustración adecuada para darle una personalidad convincente a nuestro personaje. El resultado final, componiendo lettering y gráfica, te dejará deslumbrado.</p><p>Yo soy Laynnes, un diseñador, ilustrador y animador apasionado por los cartoons y tu profesor el día de hoy.</p><p>Accede con el siguiente <a href=\"https://goo.gl/ArvSnw\" rel=\"noopener noreferrer\" target=\"_blank\">Link</a></p>',NULL,NULL,3,29,356,30,1,'2018-01-01 00:00:00','2018-01-31 23:55:00',1,0,NULL,632,'2017-11-13 19:31:54','2018-01-19 19:42:14',NULL,0,0,0,NULL,NULL,0),(633,'Introducción al Retoque Fotográfico','introduccion-al-retoque-fotografico','¿QUÉ VAS A LOGRAR CON ESTE CURSO?\r\n\r\nLlevar este curso te permitirá estar listo para retocar cualquier tipo de imagen, conociendo los distintos tipos de planos, composición, iluminación y detalles que debes de utilizar y corregir. Es tu primer paso en el retoque fotográfico y una oportunidad para mejorar tus habilidades en Adobe Photoshop.','<p><strong>¿QUÉ PROYECTO VAS A REALIZAR?</strong></p><p>Al finalizar este <strong>curso de retoque digital</strong>, deberás de aplicar las técnicas vistas en el curso, y entregar cuatro retoques de imágenes, presentando el antes y después, en donde se puedan aplicar los cuatro ejemplos de planos tocados en el curso. Se deberá de explicar el por qué y el sentimiento buscado en cada imagen.</p><p>Ingresa al curso en el siguiente <a href=\"https://goo.gl/qLJeDK\" rel=\"noopener noreferrer\" target=\"_blank\">Link</a></p>','<p><strong>¿QUÉ INCLUYE ESTE CURSO?</strong></p><p>En este <strong>curso de retoque digital</strong>, aprenderás:</p><p>- Interfaz de Adobe Photoshop<br>- Plano general, a detalle y contrapicado<br>- Ventajas y diferencias de planos<br>- Iluminación<br>- Retoque<br>- Máscaras<br>- Filtros inteligentes<br>- Regla de tercios<br>- Edición de imagen no destructiva</p><p>Ingresa al curso en el siguiente <a href=\"https://goo.gl/qLJeDK\" rel=\"noopener noreferrer\" target=\"_blank\">Link</a></p>','<p>La fotografía es un arte que tiene bastante ciencia atrás. Desde cómo tomar una foto, considerando los settings de la cámara y el entorno y ángulo en el que es tomada, hasta el trabajo en retoque y edición que se realiza, una fotografía puede tener un trabajo más grande del que se imagina.</p><p>En este <strong>curso de retoque digital</strong> podrás descubrir todo acerca de los distintos tipos de planos, las ventajas de cada uno, la composición, iluminación y corrección de detalles vitales para llegar a expresar el sentimiento de una fotografía.</p><p>Soy Abel Silva, artista digital especializado en el uso de Adobe Photoshop y Cinema 4D.</p><p>Ingresa al curso en el siguiente <a href=\"https://goo.gl/qLJeDK\" rel=\"noopener noreferrer\" target=\"_blank\">Link</a></p>',NULL,NULL,3,29,356,30,1,'2018-01-01 00:00:00','2018-01-31 00:00:00',1,0,NULL,633,'2017-11-13 20:15:28','2018-01-19 19:41:50',NULL,0,0,0,NULL,NULL,0),(634,'Becas para estudiantes de Agronomía o Forestal','becas-para-estudiantes-de-agronomia-o-forestal','OPORTUNIDAD PARA LAS PERSONAS QUE ESTUDIAN INGENIERÍA AGRONOMIA Y AMBIENTAL 2018.','<p>Jóvenes arriba ofrece becas para los estudiantes que se encuentran entre 3ero hasta 8vo semestre</p><p>La beca cubre los gastos generales de Q 2,000.00 y salario para dos meses de trabajo Q 4,000.00. &nbsp;El trabajo es en empresas de agropecuaria en el campo, trabajando bajo supervisión de agrónomos.</p>','<p>Vivir en el municipio de Rabinal</p><p>Ser de escasos recursos</p><p>Tener promedios de 70% de calificaciones en el último año de estudios y mantenerlo.</p><p>Estar libre para trabajar los dos meses o más.</p><p>Conseguir una carta de recomendación</p><p>Participar en reuniones de becados cada mes.</p>','<p>Para mayor información avocarse a la oficina de jóvenes Arriba en la 6ta ave., 02-41, entre 2da y 3era calle zona 3 de Rabinal, Baja Verapaz, dos puertas al lado del hotel El Conquistador.</p><p>Horario de atención: Lunes hasta miércoles, de 8:30 a 16:30, jueves y domingos de 8:30 a 12:30</p>',NULL,NULL,3,24,300,151,2,'2017-11-13 00:00:00','2017-12-31 23:55:00',1,1,NULL,634,'2017-11-13 20:41:45','2017-11-13 20:41:45',NULL,0,0,0,NULL,NULL,0),(640,'Coordinador (a) de Proyecto Alta Verapaz Swisscontact','coordinador-a-de-proyecto-alta-verapaz-swisscontact','Duración: Cuatro años (enero 2018- diciembre 2021)\r\nSede: Condiciones: Cobán, Alta Verapaz, Guatemala (100%) con viajes a Guatemala Contrato local con salario competitivo.\r\nEnviar hoja de vida con carta de motivación, fotografía reciente, copia título, documentos de soporte e historial salarial, hasta el 10 de diciembre de 2017, con el asunto: Coordinador (a) de Proyecto a la siguiente dirección e-mail: info.swisscontact@gmail.com','<p style=\"text-align: justify;\">• Con el apoyo del Director País de Swisscontact, liderar la Fase de Incepción del proyecto consistiendo de: la realización de una serie de diagnósticos de los sistemas de mercado con el apoyo de expertos internacionales y locales; el diseño participativo de intervenciones en diferentes subsistemas; la planificación de la fase principal del proyecto; y la redacción del Documento de Proyecto.</p><p style=\"text-align: justify;\">• Conformar, capacitar y dirigir un equipo multidisciplinario de profesionales a lo largo de todo el ciclo del proyecto hacia el logro de un impacto a escala con sostenibilidad e inclusión.&nbsp;</p><p style=\"text-align: justify;\">• Realizar la planificación estratégica, financiera y operativa del proyecto en el marco del presupuesto aprobado.&nbsp;</p><p style=\"text-align: justify;\">• Gestionar eficientemente el proyecto en todas sus dimensiones (financiera, administrativa y operativa) en el marco de la planificación estratégica y presupuestaria aprobada por el donante.&nbsp;</p><p style=\"text-align: justify;\">• Coordinar relaciones interinstitucionales y negociar acuerdos de cooperación con actores públicos y privados.&nbsp;</p><p style=\"text-align: justify;\">• Contratar y supervisar consultorías y misiones internacionales de apoyo garantizando el logro de productos de calidad.&nbsp;</p><p style=\"text-align: justify;\">• Asegurar la documentación completa y oportuna del proyecto, incluyendo informes narrativos y financieros de acuerdo con los estándares de Swisscontact y el donante.&nbsp;</p><p style=\"text-align: justify;\">• Asesorar y apoyar a las organizaciones locales socias en su desarrollo organizacional.&nbsp;</p><p style=\"text-align: justify;\">• Con el apoyo de la oficina de Swisscontact en Guatemala, garantizar el cumplimiento de los procedimientos administrativos de la organización y de todos los requisitos legales.&nbsp;</p><p style=\"text-align: justify;\">• Promover el aprendizaje y la gestión del conocimiento en el equipo y comunicar las lecciones aprendidas, las mejores prácticas y los resultados del proyecto a los socios del sector público y privado y a las partes interesadas.&nbsp;</p><p style=\"text-align: justify;\">• Informar oportunamente al donante, socios y otras partes interesadas sobre la planificación y el progreso de la ejecución del proyecto, con base en un sólido sistema de seguimiento y medición de resultados.</p>','<p>• Grado mínimo de maestría en economía, ciencias sociales o similar.&nbsp;</p><p>• Experiencia mínima de 5 años como coordinador/a de un proyecto de desarrollo de la cooperación internacional&nbsp;</p><p>• Experticia en la temática de Desarrollo Económico Inclusivo (M4P), con énfasis en empoderamiento económico de mujeres y jóvenes, con enfoque de emprendimiento y creación de empleo.&nbsp;</p><p>• Fortaleza en gestión de proyectos con base a resultados y gestión de proyectos sensible a conflictos.&nbsp;</p><p>• Fuerte capacidad de organización, planificación, gestión y experiencia trabajando en equipo.&nbsp;</p><p>• Altas capacidades analíticas y de investigación con habilidades sobresalientes para redactar informes.&nbsp;</p><p>• Fuertes habilidades interpersonales, de empatía, comunicación, motivación, presentación y moderación.&nbsp;</p><p>• Conocimientos del contexto económico, social e institucional en Alta Verapaz son altamente deseables.&nbsp;</p><p>• Conocimientos teóricos y prácticos del enfoque de trabajo “Desarrollo de Sistemas de Mercado” / M4P son altamente deseables.&nbsp;</p><p>• Dominio del idioma inglés (escrito y hablado) es altamente deseable.</p>','<p style=\"text-align: center;\"><strong>Tareas</strong></p><p style=\"text-align: justify;\">&nbsp;• Con el apoyo del Director País de Swisscontact, liderar la Fase de Incepción del proyecto consistiendo de: la realización de una serie de diagnósticos de los sistemas de mercado con el apoyo de expertos internacionales y locales; el diseño participativo de intervenciones en diferentes subsistemas; la planificación de la fase principal del proyecto; y la redacción del Documento de Proyecto.&nbsp;</p><p style=\"text-align: justify;\">• Conformar, capacitar y dirigir un equipo multidisciplinario de profesionales a lo largo de todo el ciclo del proyecto hacia el logro de un impacto a escala con sostenibilidad e inclusión.&nbsp;</p><p style=\"text-align: justify;\">• Realizar la planificación estratégica, financiera y operativa del proyecto en el marco del presupuesto aprobado.&nbsp;</p><p style=\"text-align: justify;\">• Gestionar eficientemente el proyecto en todas sus dimensiones (financiera, administrativa y operativa) en el marco de la planificación estratégica y presupuestaria aprobada por el donante.&nbsp;</p><p style=\"text-align: justify;\">• Coordinar relaciones interinstitucionales y negociar acuerdos de cooperación con actores públicos y privados.&nbsp;</p><p style=\"text-align: justify;\">• Contratar y supervisar consultorías y misiones internacionales de apoyo garantizando el logro de productos de calidad.&nbsp;</p><p style=\"text-align: justify;\">• Asegurar la documentación completa y oportuna del proyecto, incluyendo informes narrativos y financieros de acuerdo con los estándares de Swisscontact y el donante.&nbsp;</p><p style=\"text-align: justify;\">• Asesorar y apoyar a las organizaciones locales socias en su desarrollo organizacional.</p><p style=\"text-align: justify;\">• Con el apoyo de la oficina de Swisscontact en Guatemala, garantizar el cumplimiento de los procedimientos administrativos de la organización y de todos los requisitos legales.&nbsp;</p><p style=\"text-align: justify;\">• Promover el aprendizaje y la gestión del conocimiento en el equipo y comunicar las lecciones aprendidas, las mejores prácticas y los resultados del proyecto a los socios del sector público y privado y a las partes interesadas.&nbsp;</p><p style=\"text-align: justify;\">• Informar oportunamente al donante, socios y otras partes interesadas sobre la planificación</p>',NULL,NULL,3,23,NULL,30,5,'2017-11-28 00:00:00','2017-12-10 23:55:00',1,0,NULL,640,'2017-11-28 15:49:36','2017-11-28 15:49:36',NULL,0,0,0