te arte podrán aprender paso a paso a realizar nuevas y divertidas figuras en globo.</p>',NULL,NULL,'https://goo.gl/a61G4t',133,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,76,NULL,'2017-07-06 19:52:16','2017-07-06 19:52:36',NULL,0,0,0,NULL,NULL,0),(1328,'Curso completo de cocina paso a paso para principiantes','curso-completo-de-cocina-paso-a-paso-para-principiantes','Curso de Cocina para principiantes, donde aprenderás paso a paso y de forma práctica a cocinar deliciosos platos fuertes, entradas y antojos. \r\nSi no tienes habilidades para la cocina, o quieres sorprender a tu familia con un rico plato fuerte en días nor','<p>Curso de Cocina para principiantes, donde aprenderás paso a paso y de forma práctica a cocinar deliciosos platos fuertes, entradas y antojos.</p><p>Si no tienes habilidades para la cocina, o quieres sorprender a tu familia con un rico plato fuerte en días normales o fechas espaciales, este es el curso indicado para poder convertirte en un profesional de la cocina.</p>',NULL,NULL,'https://goo.gl/vfdksi',133,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,77,NULL,'2017-07-06 19:58:04','2017-07-06 19:58:04',NULL,0,0,0,NULL,NULL,0),(1329,'Elaboración de Velas aromáticas','elaboracion-de-velas-aromaticas','Este es el canal de Youtube de www.granvelada.com Te mostramos vídeos tutoriales con recetas para hacer jabones, hacer velas, hacer cremas y mucho más. Además, podrás encontrar vídeos comerciales e información sobre los productos de Gran Velada. Si quiere','<p><strong>En este canal de Youtube te mostramos vídeos tutoriales con recetas para hacer jabones, hacer velas, hacer cremas y mucho más. Además, podrás encontrar vídeos comerciales e información sobre los productos de Gran Velada. Si quieres comprar los productos que utilizamos en los vídeos puedes hacerlo en http://www.granvelada.com/es/ ¡Visita ahora nuestra tienda de materiales para manualidades DIY y conoce mejor todo lo que podemos ofrecerte!</strong></p>',NULL,NULL,'https://goo.gl/xyXTiB',133,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,78,NULL,'2017-07-06 20:04:33','2017-07-06 20:15:48',NULL,0,0,0,NULL,NULL,0),(1330,'Técnicas básicas para la preparación de comida de mar','tecnicas-basicas-para-la-preparacion-de-comida-de-mar','Cuando hayas concluido el Curso de Cocina de mar habrás adquirido la técnica y destreza necesaria para ejecutar estos delicados platos además conocerás los trucos para dar esa sazón especial que tiene este tipo de comida.','<p>La comida de mar tiene un gusto y sabor especial, maneja una gran cantidad de matices y genera sensaciones de emoción y placer cuando la comemos, claro que degustarla es una cosa y prepararla es otra muy distinta por esta razón al Curso de Cocina de Mar, es tu alternativa para aprender esos trucos y refinados platos que el mar puede ofrecer a nuestras</p>',NULL,NULL,'https://goo.gl/EECzWX',133,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,79,NULL,'2017-07-06 20:37:03','2017-07-06 20:37:03',NULL,0,0,0,NULL,NULL,0),(1331,'Empieza tu propio Negocio','empieza-tu-propio-negocio','Al culminar el curso de Como empezar tu negocio, tendrás los conocimientos necesarios para embarcarte de lleno en tu idea conociendo factores importantes como la afluencia de mercado para el producto o servicio que deseas comercializar, los riesgos de inv','<p>Para ti que tienes una mente emprendedora y buscas la oportunidad de crear tú propia empresa, que te gusta ser dueño de tu tiempo, con el curso de Empezar tu Negocio, te enseñara todos los factores que debes tener en cuenta y los riesgos que conlleva la inversión de capital.</p>',NULL,NULL,'https://goo.gl/nxqPnj',133,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,80,NULL,'2017-07-06 20:45:09','2017-07-06 20:45:09',NULL,0,0,0,NULL,NULL,0),(1332,'Empresas en Redes sociales','empresas-en-redes-sociales','Al culminar el curso de empresas en redes sociales conocerás como emplear las redes sociales para impulsar tu negocio y como aprovechar las ventajas de expansión que estas ofrecen.','<p>Curso de Empresas en Redes Sociales, en la actualidad las redes sociales no parecen tener un límite en lo que respecta al alcance de público que obtienen esta gran afluencia de usuarios se convierte en una oportunidad para dar a conocer productos y servicios en Internet.</p><p>El curso de empresas en redes sociales, está dividido en 22 clases donde aprenderemos más sobre este tipo de empresas de cómo las Empresas en Redes sociales (Social Business) pueden ser una idea innovadora y de muy buena explotación comercial; pero también sus riesgos debido al impacto que puede tener el Internet sobre estas.</p>',NULL,NULL,'https://goo.gl/6remjJ',133,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,81,NULL,'2017-07-06 20:50:56','2017-07-06 20:50:56',NULL,0,0,0,NULL,NULL,0),(1333,'Costura y confeccion','costura-y-confeccion','Prepárate para cortar y confeccionar prendas sencillas.','<p>En esta capacitación aprenderás a elegir telas, modelos, tomar medidas, trazar patrones &nbsp; &nbsp; &nbsp; &nbsp;y cortarlos en tela, hilvanar, confeccionar y entregar las prendas.</p>',NULL,NULL,'https://capacitateparaelempleo.org/pages.php?r=.tema&tagID=1754',8807,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,82,NULL,'2017-07-17 14:58:12','2017-07-17 15:05:16',NULL,0,0,0,NULL,NULL,0),(1334,'Cursos libres y gratuitos Calusac 2017','cursos-libres-y-gratuitos-calusac-2017','Con el Programa de Cursos Libres, los guatemaltecos tienen la oportunidad de tener acceso a conocimientos técnicos y científicos. Las clases darán inicio el sábado 5 de agosto y finalizarán el sábado 7 de octubre, en las aulas de la USAC.','<p>Las inscripciones en línea para los cursos libres 2017 de la Universidad de San Carlos de Guatemala —USAC— estarán abiertas del 31 de julio al 4 de agosto de 2017. Todos los cursos son gratuitos y existe una gran variedad de materias académicas y técnicas.</p>',NULL,NULL,'https://www.guatemala.com/noticias/sociedad/cursos-libres-y-gratuitos-en-la-usac-2017-ciudad-de-guatemala.html?utm_source=guatemala.com&utm_campaign=crosslinking&utm_medium=widget',8807,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,83,NULL,'2017-08-03 19:15:50','2017-08-03 19:15:50',NULL,0,0,0,NULL,NULL,0),(1335,'Khan Academy','khan-academy','Un recurso de aprendizaje personalizado, para todas las edades','<p>Khan Academy ofrece ejercicios de práctica, videos instructivos y un panel de aprendizaje personalizado que permite a los alumnos aprender a su propio ritmo, dentro y fuera del salón de clases. Abordamos las matemáticas, la ciencia, la programación de computadoras, la historia, la historia del arte, la economía y más. Nuestras misiones de matemáticas guían a los alumnos desde el jardín de niños hasta el cálculo, por medio de una tecnología novedosa y adaptable, que identifica las fortalezas y las lagunas en el aprendizaje. Tenemos convenios con instituciones como la NASA, el Museo de Arte Moderno (MoMA) de Nueva York, la Academia de Ciencias de California y el Instituto Tecnológico de Massachusetts (MIT) para ofrecer contenido especializado.</p><p><br></p><p>Khan Academy es una organización educativa sin ánimo de lucro y un sitio web creado en 2006 por el educador estadounidense Salman Khan, egresado del Instituto Tecnológico de Massachusetts y de la Universidad de Harvard.&nbsp;</p>',NULL,NULL,'https://es.khanacademy.org/',2,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,84,NULL,'2017-10-26 19:32:37','2017-10-26 19:43:19',NULL,0,0,0,NULL,NULL,0),(1336,'Desarrolla tu modelo de negocio','desarrolla-tu-modelo-de-negocio','Metodología que para desarrollar productos y servicios, Crea tu negocio.','<p>Descubre el modelo Business Model Canvas, el sistema que está revolucionando los modelos de negocio y que usan la mayor parte de las startups tecnológicas de todo el mundo de la mano de Steve Blank, uno de los empresarios más reconocidos en Silicon Valley.&nbsp;</p><p>Lean Startup es una metodología para desarrollar negocios y productos. La metodología apunta a acortar los ciclos de desarrollo de productos adoptando una combinación de experimentación impulsada.</p><p>Para poder empezar a aprender, primero debes inscribirte en el curso.&nbsp;</p>',NULL,NULL,'https://learn.unimooc.com/student/courses/course?course=steve-blank',2,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,85,NULL,'2017-10-26 20:26:20','2017-10-26 20:26:45',NULL,0,0,0,NULL,NULL,0),(1337,'Cursos de Corte y Confección Online','cursos-de-corte-y-confeccion-online','A través de este curso aprenderemos las técnicas necesarias para trabajar en costura y sastrería. Así generar un espacio donde compartir tendencias, novedades y recomendaciones de lo último en sastrería y costura.','<p>En el ámbito empresarial son indispensables unos adecuados hábitos de higiene y un correcto comportamiento social para lograr una mayor proyección laboral. Un buen ejecutivo debe preocuparse por su apariencia personal y por tener buenos modales. Debe saber como desenvolverse no solamente en la oficina sino en el as-pecto social que implica las relaciones empresariales.&nbsp;</p><p><br></p><p>Según lo anterior, podemos señalar: pasamos la mayor parte del día en la empresa, por tanto, comportarnos adecuadamente y cuidar con esmero la presentación personal es imprescindible, máxime si se quiere generar un ambiente laboral propicio y proyectar una imagen positiva frente a las directivas, pares, colegas, subalternos, clientes y demás públicos institucionales. De este modo, para observar esto hay que considerar.</p><p><br></p><p>“<em>El buen ejecutivo se debe caracterizar por su comportamiento y presentación personal impecables”</em></p><p>“<em>La elegancia y el estilo están definidos por la sencillez, la discreción y los buenos modales”</em></p><p>“<em>No hay una segunda oportunidad para una primera impresión</em>”</p>',NULL,NULL,'https://goo.gl/kbGCmr',133,NULL,NULL,NULL,NULL,7,NULL,NULL,1,0,86,NULL,'2018-01-29 18:43:55','2018-01-29 18:43:55',NULL,0,0,0,NULL,NULL,0);
